  //     if (time > item.time + 6000) {
  //       tableData.splice(tableData.indexOf(item), 1);
  //     }
  //   };
  // }, 6000);

  return (
    <table>
      <thead>
      <tr>
        <th>Index</th>
        <th>Serial Number</th>
        <th>Distance</th>
      </tr>
      </thead>
      <tbody>
      {/* {dataArray.map((item, index) =>
      <tr>
        <td>{index + 1}</td>
        <td>{item.data.serialNumber}</td>
        <td>{item.data.distance}</td>
      </tr>
      )} */}
      </tbody>
    </table>
  )
};

export default Table;
